 Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 2393 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 1138.55 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 42.01 s &lt;/li&gt;\n&lt;li&gt; transfer time: 1.54 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.1.9:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 64 &lt;/li&gt;\n          &lt;li&gt; Threads: 1536 &lt;/li&gt;\n          &lt;li&gt; Memory: 10.80 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"callback":{"id":"1138"}},"id":"1139","type":"TapTool"},{"attributes":{"coordinates":null,"formatter":{"id":"1207"},"group":null,"major_label_orientation":-0.5,"major_label_policy":{"id":"1456"},"minor_tick_line_alpha":0,"ticker":{"id":"1209"}},"id":"1193","type":"LinearAxis"},{"attributes":{},"id":"1127","type":"BasicTicker"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1324","type":"AdaptiveTicker"},{"attributes":{"line_alpha":0.1,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1309","type":"Line"},{"attributes":{},"id":"1506","type":"UnionRenderers"},{"attributes":{"source":{"id":"1002"}},"id":"1035","type":"CDSView"},{"attributes":{},"id":"1161","type":"CategoricalScale"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1277","type":"Line"},{"attributes":{},"id":"1507","type":"Selection"},{"attributes":{"axis":{"id":"1259"},"coordinates":null,"group":null,"ticker":null},"id":"1262","type":"Grid"},{"attributes":{},"id":"1049","type":"BasicTicker"},{"attributes":{},"id":"1257","type":"LinearScale"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{"coordinates":null,"group":null},"id":"1417","type":"Title"},{"attributes":{},"id":"1267","type":"ResetTool"},{
